// Decryption.js
import { useState } from "react";
import ToBits from "./ToBits";

const HEADER_BITS = [1,0,1,0,1,0,1,1];

export default function Decryption() {
  const [gifFile, setGifFile] = useState(null);
  const [frames, setFrames] = useState([]);
  const [error, setError] = useState(null);
  const [password, setPassword] = useState("");
  const [metadata, setMetadata] = useState(null);

  // Handle GIF upload
  const handleGIFChange = (e) => {
    const file = e.target.files[0];
    if (!file) return;
    setGifFile(file);

    ToBits(file)
      .then(({ frames }) => setFrames(frames))
      .catch(err => setError(err.message));
  };

  // Extract binary data
  const handleExtractBinary = () => {
    if (!frames.length) return;

    const first = frames[0];
    const headerLSBs = [];
    for (let i = 0; i < 8; i++) {
      headerLSBs.push(first.patch[i*4 + 2] & 1);
    }

    // Compare header bits
    let headerMatches = true;
    for (let i = 0; i < HEADER_BITS.length; i++) {
      if (headerLSBs[i] !== HEADER_BITS[i]) {
        headerMatches = false;
        break;
      }
    }

    if (!headerMatches) {
      console.warn("Header read from GIF:", headerLSBs);
      console.warn("Expected HEADER_BITS:", HEADER_BITS);
      setError("Header not found in GIF.");
      return;
    }

    // Extract all bits after header
    const allBits = [];
    for (let frameIndex = 0; frameIndex < frames.length; frameIndex++) {
      const patch = frames[frameIndex].patch;
      const startPixel = frameIndex === 0 ? HEADER_BITS.length : 0;
      for (let i = startPixel * 4; i < patch.length; i += 4) {
        allBits.push(patch[i + 2] & 1);
      }
    }

    // Convert bits to text
    let binaryText = '';
    for (let i = 0; i < allBits.length; i++) {
      binaryText += allBits[i];
      if (i % 8 === 7) {
        binaryText += ' ';
      }
    }

    // Download binary text
    const blob = new Blob([binaryText], { type: 'text/plain' });
    const a = document.createElement('a');
    a.href = URL.createObjectURL(blob);
    a.download = 'binary_data.txt';
    a.click();
  };

  // Extract metadata
  const handleExtractMetadata = () => {
    if (!frames.length) return;

    const first = frames[0];
    const headerLSBs = [];
    for (let i = 0; i < 8; i++) {
      headerLSBs.push(first.patch[i*4 + 2] & 1);
    }

    // Compare header bits
    let headerMatches = true;
    for (let i = 0; i < HEADER_BITS.length; i++) {
      if (headerLSBs[i] !== HEADER_BITS[i]) {
        headerMatches = false;
        break;
      }
    }

    if (!headerMatches) {
      console.warn("Header read from GIF:", headerLSBs);
      console.warn("Expected HEADER_BITS:", HEADER_BITS);
      setError("Header not found in GIF.");
      return;
    }

    // Extract all bits after header
    const allBits = [];
    for (let frameIndex = 0; frameIndex < frames.length; frameIndex++) {
      const patch = frames[frameIndex].patch;
      const startPixel = frameIndex === 0 ? HEADER_BITS.length : 0;
      for (let i = startPixel * 4; i < patch.length; i += 4) {
        allBits.push(patch[i + 2] & 1);
      }
    }

    // Extract metadata length
    const metadataLengthBits = allBits.slice(0, 32);
    const metadataLength = parseInt(metadataLengthBits.join(''), 2);

    // Extract metadata bits
    const metadataBits = allBits.slice(32, 32 + metadataLength);

    // Convert metadata bits to bytes
    const metadataBytes = [];
    for (let i = 0; i < metadataBits.length; i += 8) {
      const byte = parseInt(metadataBits.slice(i, i + 8).join(''), 2);
      metadataBytes.push(byte);
    }

    // Convert bytes to string
    const metadataString = String.fromCharCode(...metadataBytes);

    // Parse string as JSON
    const metadata = JSON.parse(metadataString);

    // Print metadata to console
    console.log(metadata);
    setMetadata(metadata);
  };

  // Decrypt data
  const handleDecrypt = () => {
    if (!metadata || !password) return;
    // Add decryption logic here
  };

  return (
    <div>
      <h2>Decrypt GIF Binary Data</h2>
      <input type="file" accept="image/gif" onChange={handleGIFChange} />
      {gifFile && <p>Uploaded GIF: {gifFile.name}</p>}
      {frames.length > 0 && <button onClick={handleExtractBinary}>Extract Binary Data</button>}
      {frames.length > 0 && <button onClick={handleExtractMetadata}>Extract Metadata</button>}
      <input type="password" placeholder="Decryption password" value={password} onChange={(e) => setPassword(e.target.value)} />
      {metadata && <button onClick={handleDecrypt}>Decrypt Data</button>}

      {error && <p className="error">{error}</p>}
      {metadata && <p>Metadata: {JSON.stringify(metadata)}</p>}
    </div>
  );
}
